import React from "react";
import "./ItemSub1Card.css";

function ItemSub1Card() {
  return (
    <>
      <div>
        <div className="card">
          <div className="image">
            <img src={props.Bimg} alt="" />
          </div>
          <div className="content">
            <p className="name">{props.BName}</p>
            <p className="price">{props.BPrice}</p>
          </div>
        </div>
      </div>
    </>
  );
}

export default ItemSub1Card;
